  global: {
    colors: {
      brand: '#66FF00',
    },
    font: {
      family: 'Roboto',
      size: '20px',
      height: '20px',
      weight: 'bold',
      color: '#000000',
    },
  },
};

const AppBar = (props: JSX.IntrinsicAttributes & BoxExtendedProps) => (
  <Box
    tag='header'
    direction='row'
    align='center'
    justify='between'
    background='brand'
    pad={{ left: 'medium', right: 'small', vertical: 'small' }}
    elevation='medium'
    style={{ zIndex: '1' }}
    {...props}
  />
);

